// App.js
import React, { useState } from 'react';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import PlayerForm from './PlayerForm';
import Game from './Game';

const App = () => {
  const [player1Name, setPlayer1Name] = useState('');
  const [player2Name, setPlayer2Name] = useState('');

  const handleStartGame = () => {
    // Aquí puedes realizar cualquier lógica adicional antes de comenzar el juego
    // Por ejemplo, validar que se hayan ingresado los nombres de los jugadores
    console.log('Comenzar juego');
  };

  return (
    <Router>
      <Route
        exact
        path="/"
        render={() => (
          <PlayerForm
            player1Name={player1Name}
            player2Name={player2Name}
            setPlayer1Name={setPlayer1Name}
            setPlayer2Name={setPlayer2Name}
            handleStartGame={handleStartGame}
          />
        )}
      />
      <Route
        path="/game"
        render={() => <Game player1Name={player1Name} player2Name={player2Name} />}
      />
    </Router>
  );
};

export default App;
